import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Map from './Map';
import Preferences from './Preferences';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Map />} />
        <Route path="/map" element={<Map />} />
        <Route path="/preferences" element={<Preferences />} />
      </Routes>
    </Router>
  );
}

export default App;
